░░░░░░░░░░      ░░░░░    ░░░░░    ░░░░░ ░░░░░   ░░░░░ ░░░░░     ░░░░░ ░░░░░ ░░░░░ ░░░░░ 

> More information on https://dynamix.finance/

*****************************************************************************************/

import "./IERC20.sol";
import "./Reward.sol";
import "./Fee.sol";
import "./Address.sol";
import "./Swap.sol";

contract Dynamix is Reward, IERC20, Fee, Swap {
	using SafeMath for uint256;
	using Address for address;

	mapping (address => mapping (address => uint256)) private _allowances;

	string public name = 'Dynamix';
    string public symbol = 'DYNA';
    uint8 public decimals = 9;

	constructor(uint256 totalSupply) 
		public Reward(totalSupply) {
			emit Transfer(address(0), _msgSender(), totalSupply);
	}

	function totalSupply() public view override returns (uint256) {
        return _tokenSupply;
    }

	function balanceOf(address account) public view override returns (uint256)  {
        if (_balances[account].excludedFromReward) 
			return _balances[account].token;

        return _rewardToToken(_balances[account].reward);
    }

	function transfer(address recipient, uint256 amount) public override returns (bool) {
		 _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender) public view override returns (uint256) {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount) public override returns (bool) {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(address sender, address recipient, uint256 amount) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(sender, _msgSender(), _allowances[sender][_msgSender()].sub(amount, "ERC20: transfer amount exceeds allowance"));
        return true;
    }

	function _approve(address owner, address spender, uint256 amount) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

	// Internal Transfer, and fee management
	function _transfer(address sender, address recipient, uint256 amount) private {
		uint256 rewardFee = 0;
		bool excludedFromFee = _excludedFromFee[sender] || _excludedFromFee[recipient];

		if(!excludedFromFee) {
			if(_isBuy(sender)) {
				(uint256 rFee, uint256 tokenToTeam, uint256 tokenToOwner) = _getBuyFee(amount, holders);
				_transfer(sender, teamAddress, tokenToTeam, 0);

				// Init timestamp for token hold
				_balances[recipient].timestamp = block.timestamp;

				rewardFee = rFee;
				amount = tokenToOwner;

				emit Transfer(sender, teamAddress, tokenToTeam);
			}

			if(_isSell(recipient)) {
				(uint256 tokenToBuyBack, uint256 tokenToTeam, uint256 tokenToOwner) = _getSellFee(amount, _balances[sender].timestamp);
				_transfer(sender, teamAddress, tokenToTeam, 0);
				_transfer(sender, address(this), tokenToBuyBack, 0);

				amount = tokenToOwner;

				emit Transfer(sender, teamAddress, tokenToTeam);
				emit Transfer(sender, address(this), tokenToBuyBack);

				if(!inSellOrBuy)
					_sellAndBuy();
			}
		}

        amount = _transfer(sender, recipient, amount, rewardFee);

		emit Transfer(sender, recipient, amount);
	}

    receive() external payable {}

	bool inSellOrBuy;

	modifier lockTheSwap {
        inSellOrBuy = true;
        _;
        inSellOrBuy = false;
    }

	// Sell and BuyBack
	function _sellAndBuy() private lockTheSwap {
		if(autoBuyBackEnabled){

			// Sell Tokens for BuyBack
			uint256 contractToken = balanceOf(address(this));
			if (contractToken >= minimumTokensBeforeSell) {
				_approve(address(this), address(uniswapV2Router), contractToken);
				_swapTokensForBNB(contractToken); 	
			}

			// Buy Tokens
			uint256 contractBnb = address(this).balance;

			if (contractBnb >= minimumBNBBeforeBuy) 
				_approve(address(this), address(uniswapV2Router), contractBnb);
				_buyBackAndBurnToken(contractBnb); // BuyBack and Burn
		}
	}

	// Before PreSale, no fees
	function beforePreSale() external onlyOwner()  {
		sellFee = 0;
		buyFee = 0;
		autoBuyBackEnabled = false;
		minimumTokensBeforeSell = 0;
		minimumBNBBeforeBuy = 0;

		emit PreSaleStarted(sellFee, buyFee);
    }

	// After PreSale, initialization fees
	function afterPreSale(address account) external onlyOwner()  {
		sellFee = 17;
		buyFee = 12;
		_pair[account] = true;
		autoBuyBackEnabled = true;
		minimumTokensBeforeSell = 1000 * 10**9 * 10**9;
		minimumBNBBeforeBuy = 1 * 10**16;

		emit PreSaleCompleted(sellFee, buyFee);
    }
}"},"Fee.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity >=0.6.0 <0.7.0;

import "./Ownable.sol";
import "./SafeMath.sol";
import "./Address.sol";

contract Fee is Ownable {		
	using SafeMath for uint256;
	using Address for address;

    mapping (address => bool) internal _pair;
    mapping (address => bool) internal _excludedFromFee;

	uint256 public sellFee = 0;
	uint256 public buyFee = 0;

	address public teamAddress = 0x34A1a24BB6C8a692e6F5f7650C89bd88cB51A28d;

	event PreSaleStarted(
        uint256 sellFee,
        uint256 buyFee
    );

	event PreSaleCompleted(
        uint256 sellFee,
        uint256 buyFee
    );

	event TeamAddressChanged(
        address addr
    );

	constructor() internal {
		address deadAddress = 0x000000000000000000000000000000000000dEaD;

		_excludedFromFee[_msgSender()] = true;
		_excludedFromFee[address(this)] = true;
		_excludedFromFee[teamAddress] = true;
		_excludedFromFee[deadAddress] = true;
	}

	// Manage Excluded Addr
	function setExcludedFromFee(address account, bool excluded) external onlyOwner()  {
        _excludedFromFee[account] = excluded;
    }	

	// Manage Pair Address
	function setPair(address account, bool isPair) external onlyOwner()  {
        _pair[account] = isPair;
    }	

	// Is Tx Buy (in another words from pair)
	function _isBuy(address sender) internal view returns(bool) {
        return _pair[sender];
    }

	// Is Tx Sell (in another words to pair)
	function _isSell(address recipient) internal view returns(bool) {
        return _pair[recipient];
    }

	// Get Buy Fee (depending holders)
	function _getBuyFee(uint256 amount, uint256 holders) internal view returns(uint256, uint256, uint256) {
		if(buyFee == 0) 
			return (0, 0, amount);

		uint256 rewardFee = _getRewardFee(holders);
		uint256 teamFee = buyFee - rewardFee;

		uint256 tokenToTeam = amount.mul(teamFee).div(100);
        uint256 tokenToOwner = amount.sub(tokenToTeam);

		return (rewardFee, tokenToTeam, tokenToOwner);
    }

	// Get Reward Fee (depending holders)
	function _getRewardFee(uint256 holders) internal pure returns(uint256) {
        if(holders <= 10000)
			return 2;
        if(holders <= 20000)
			return 3;
        if(holders <= 50000)
			return 4;
		if(holders <= 100000)
			return 6;

		return 8;
    }

	// Get Sell Fee (depending hold time)
	function _getSellFee(uint256 amount, uint timestamp) internal view returns(uint256, uint256, uint256) {
		if(sellFee == 0) 
			return (0, 0, amount);

		uint256 fee = _getHoldFee(timestamp);

		uint256 tokenToTeam = amount.mul(fee).div(100);
        uint256 tokenToOwner = amount.sub(tokenToTeam);

        uint256 tokenToBuyBack = tokenToTeam.mul(35).div(100);
		tokenToTeam = tokenToTeam.sub(tokenToBuyBack);

		return (tokenToBuyBack, tokenToTeam, tokenToOwner);
    }

	// Get Hold Fee (depending hold time)
	function _getHoldFee(uint timestamp) internal view returns(uint256) {
        uint diff = block.timestamp - timestamp;

		if(diff <= 604800) // 1 Week: 3600 * 24 * 7
			return sellFee;
		if(diff <= 2592000) // 1 Month: 3600 * 24 * 30
			return 14;
		if(diff <= 15552000) // 6 Months: 3600 * 24 * 30 * 6
			return 8;

		return 5; // > 6 Months
    }

	// Set Team Address
	function setTeamAddress(address addr) external onlyOwner() {
        teamAddress = addr;
		_excludedFromFee[teamAddress] = true;

		TeamAddressChanged(addr);
    }

	// Disable Fee
	function disableFee() external onlyOwner()  {
		sellFee = 0;
		buyFee = 0;
    }

	// Enable Fee
	function enableFee() external onlyOwner()  {
		sellFee = 17;
		buyFee = 12;
    }
}"},"Holder.sol":{"content":"// SPDX-License-Identifier: MIT
pragma solidity >=0.6.0 <0.7.0;

contract Holder {		
    uint256 public holders;

	constructor() internal {
		holders = 0;
	}

	// Before Transfer Token to recipient
	function recipientTransfert(uint256 recipientAmount) internal {
		if(recipientAmount == 0)
			holders++;
	}		

	// After Transfer Token from sender
	function senderTransfert(uint256 senderAmount) internal {
		if(senderAmount == 0)
			holders--;
	}
}"},"IERC20.sol":{"content":"// SPDX-License-Identifier: MIT
